// LoginPage.js

import React from "react";
import "./LoginPage.css";

function LoginPage() {
    return (
        <>
            <p className="title">Registration Form</p>
            <div className="login">

            
            <form className="App">
                <input type="text" style={{ marginBottom: '10px', padding: '5px' }} />
                <input type="email" style={{ marginBottom: '10px', padding: '5px' }} />
                <input type="password" style={{ marginBottom: '10px', padding: '5px' }} />
                <input type={"submit"} style={{ backgroundColor: "#a1eafb", padding: '10px', border: 'none', cursor: 'pointer' }} />
            </form>

            </div>
        </>
    );
}

export default LoginPage;
